import React from 'react';


const Slider = () => {
    let sliderArr = [1,2,3,4,5]
    return(
        <div className='slider'>
            {
                sliderArr.Arr.map((item,index)=>{
                    return(
                        <div className='slide'>
                            {item}
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Slider;
